import React, { useState } from 'react';
import { BrowserRouter, Routes, Route, Navigate, Link } from 'react-router-dom';
import Header from './components/layout/Header.jsx';
import Footer from './components/layout/Footer.jsx';
import HeroSection from './components/sections/HeroSection.jsx';
import ReachSection from './components/sections/ReachSection.jsx';
import DiscoverPathSection from './components/sections/DiscoverPathSection.jsx';
import AboutHeroSection from './components/sections/AboutHeroSection.jsx'; 
import ScopusSection from './components/sections/ScopusSection.jsx'; 
import MOUListPage from './components/pages/MOUListPage.jsx'; 
import INTILoginPage from './components/pages/Login_Page.jsx';
import FacultyExchange from './components/sections/faculty_exchange.jsx';

// ‚úÖ Sidebar (Fixed Left)
const Sidebar = () => (
  <aside className="fixed top-[64px] bottom-[64px] left-0 w-64 bg-gray-100 border-r border-gray-300 p-5 overflow-y-auto">
    <ul className="space-y-4 text-gray-800 font-medium">
      <li>
        <Link to="/" className="block hover:text-[#AE1C30] transition-colors">üè† Home</Link>
      </li>
      <li>
        <Link to="/mou-partners" className="block hover:text-[#AE1C30] transition-colors">ü§ù MOU Partners</Link>
      </li>
      <li>
        <Link to="/faculty-exchange" className="block hover:text-[#AE1C30] transition-colors">üéì Faculty Exchange</Link>
      </li>
    </ul>
  </aside>
);

// ‚úÖ Home Page Sections
const HomePageContent = () => (
  <>
    <HeroSection />
    <AboutHeroSection />
    <ReachSection />
    <ScopusSection /> 
    <DiscoverPathSection />
  </>
);

// ‚úÖ Protected Route
const ProtectedRoute = ({ isAuthenticated, children }) => {
  return isAuthenticated ? children : <Navigate to="/login" replace />;
};

const App = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(true); // true for dev testing

  const handleLogin = () => setIsAuthenticated(true);
  const handleLogout = () => setIsAuthenticated(false);

  return (
    <BrowserRouter>
      <div className="min-h-screen flex flex-col bg-white font-sans antialiased">

        {/* ‚úÖ Header (fixed top) */}
        {isAuthenticated && (
          <div className="fixed top-0 left-0 right-0 z-50 bg-white shadow-sm">
            <Header onLogout={handleLogout} />
          </div>
        )}

        <div className="flex flex-1 mt-[64px] mb-[64px]">
          {/* ‚úÖ Sidebar (always visible and fixed) */}
          {isAuthenticated && <Sidebar />}

          {/* ‚úÖ Main Content Area */}
          <main className="flex-1 ml-64 p-6 overflow-y-auto">
            <Routes>
              {/* Login */}
              <Route 
                path="/login" 
                element={
                  isAuthenticated ? (
                    <Navigate to="/" replace />
                  ) : (
                    <INTILoginPage onLogin={handleLogin} />
                  )
                } 
              />

              {/* Protected Pages */}
              {isAuthenticated && (
                <>
                  <Route 
                    path="/" 
                    element={
                      <ProtectedRoute isAuthenticated={isAuthenticated}>
                        <HomePageContent />
                      </ProtectedRoute>
                    } 
                  />

                  <Route 
                    path="/mou-partners" 
                    element={
                      <ProtectedRoute isAuthenticated={isAuthenticated}>
                        <MOUListPage />
                      </ProtectedRoute>
                    } 
                  />

                  <Route 
                    path="/faculty-exchange" 
                    element={
                      <ProtectedRoute isAuthenticated={isAuthenticated}>
                        <FacultyExchange />
                      </ProtectedRoute>
                    } 
                  />
                </>
              )}

              {/* Fallback */}
              <Route path="*" element={<Navigate to="/login" replace />} />
            </Routes>
          </main>
        </div>

        {/* ‚úÖ Footer (fixed bottom) */}
        {isAuthenticated && (
          <div className="fixed bottom-0 left-0 right-0 bg-white shadow-inner">
            <Footer />
          </div>
        )}
      </div>
    </BrowserRouter>
  );
};

export default App;
